import styled from 'styled-components'
import { Link } from 'react-router-dom'

export const Logo = styled(Link)`
    font-size: 1rem;
    font-weight: 700;
    text-decoration: none;
    color: #fff;
    border-bottom: none;
    outline: none;
    border: none;
    border-inline: none;
`
